import { Grid } from "@mui/material";
import React from "react";

const Dashboard = () => {
    const textStyle = {color: 'white'}

    return (
        <Grid container columnGap={3} rowGap={2} marginTop={'1em'} justifyContent={'center'}>
            <Grid item border={1} borderRadius={4} xs={3} height={'10em'} bgcolor={'#262626'}>
                <h1 style={textStyle}>Hello</h1>
            </Grid>
            <Grid item border={1} borderRadius={4} xs={8} height={'10em'} bgcolor={'#262626'}>
                Hello
            </Grid>
            <Grid item border={1} borderRadius={4} xs={8} height={'10em'} bgcolor={'#262626'}>
                Hello
            </Grid>
            <Grid item border={1} borderRadius={4} xs={3} height={'10em'} bgcolor={'#262626'}>
                Hello
            </Grid>
        </Grid>
    )
}

export default Dashboard;
